const CardPay = () => {
  return (
    <div>
      <p>Credit Card Payment</p>
      <label for="name">Name on card</label>
      <input id="name" name="name" />
      <label for="number">Card number</label>
      <input id="number" name="number" type="number" maxLength={6} />
    </div>
  );
};

export default CardPay;
